import React from 'react';

class Form extends React.Component {

    handleFormSubmit = (event) => {
        event.preventDefault();

    }

    handleInputChange(){

    }

    render() {
      return (
        <form onSubmit={this.props.handleFormSubmit}> 
            <input type="text" id="session" placeholder="Session" name="session" value={this.props.newSession} onChange={this.props.handleInputChange} />
            <input type="text" id="timeslot" placeholder="Time Slot" name="timeslot" value={this.props.newTimeslot} onChange={this.props.handleInputChange} />
            <input type="text" id="speaker" placeholder="Speaker" name="speaker" value={this.props.newSpeaker} onChange={this.props.handleInputChange} />
            <input type="text" id="room" placeholder="Room" name="room" value={this.props.newRoom} onChange={this.props.handleInputChange} />
            <input type="text" id="action" placeholder="Action" name="action" value={this.props.newAction} onChange={this.props.handleInputChange} />
            <input type="button" class="add-row" value="Add Row" />
        </form>
      );
    }
  }

  export default Form;
